import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { FormServiceService } from 'src/app/service/form-service.service';
import { User } from '../Interface/interface';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

  loginForm: FormGroup;
  submitted = false;
  loginError = '';

  constructor(private fb: FormBuilder, private router: Router, private userserve: FormServiceService, private http: HttpClient) {
    this.loginForm = this.fb.group({
      email: ['', [Validators.required, Validators.email]],
      password: ['', Validators.required],
    });
  }
  //   onSubmit() {
  //     const { email, password } = this.loginForm.value;

  //     // 🔐 Check static admin login
  //     if (this.userserve.isAdmin(email, password)) {
  //       alert('Welcome Admin!');
  //       this.router.navigate(['/admin']);
  //       return;
  //     }

  //     // 👤 Check dynamic users from JSON
  //     this.userserve.loginUser(email, password).subscribe(users => {
  //       if (users.length > 0) {
  //         alert('Welcome User!');
  //         this.router.navigate(['/user']);
  //       } else {
  //         alert('Invalid credentials');
  //       }
  //     });
  //   }
  // }
  // 





  /////////////////////////////////////////////////////////////////////////////////////////////

  onSubmit() {
    const { email, password } = this.loginForm.value;

    // 1️⃣ Admin Check
    if (this.userserve.isAdmin(email, password)) {
      localStorage.setItem('isLoggedIn', 'true');
      localStorage.setItem('role', 'admin');

      const adminUser = {
        name: 'Admin',
        email: email,
        loginTime: new Date()
      };
      localStorage.setItem('loggedInUser', JSON.stringify(adminUser));

      const history = JSON.parse(localStorage.getItem('loggedUsers') || '[]');
      history.push(adminUser);
      localStorage.setItem('loggedUsers', JSON.stringify(history));

      alert('Welcome Admin!');
      this.router.navigate(['/admin']);
      return;
    }

    // 2️⃣ Regular User Check from JSON API
    this.http.get<any[]>('http://localhost:3000/users').subscribe(users => {
      const user = users.find(u => u.email === email && u.password === password);

      if (user) {
        localStorage.setItem('isLoggedIn', 'true');
        localStorage.setItem('role', 'user');

        // ✅ Store full user (including id & enrolledCourses)
        localStorage.setItem('loggedInUser', JSON.stringify(user));

        // Optional: add to login history
        const history = JSON.parse(localStorage.getItem('loggedUsers') || '[]');
        history.push({ name: user.name, email: user.email, loginTime: new Date() });
        localStorage.setItem('loggedUsers', JSON.stringify(history));

        alert('Welcome User!');
        this.router.navigate(['/user']);
      } else {
        alert('Invalid email or password');
      }
    });
  }

}
